import React from "react";
import webimage from "../src/images/codingpair.svg";
import CompCommon from "./CompCommon";

const About = () => {
  return (
    <>
     <CompCommon 
      name="About Us"
      imgsrc={webimage}
      visit="/contact"
      btnname="Contact Now"
      myname="Mamtu"
      anim="img-fluid animatedAbout"
     />
    </>
  );
};

export default About;
